import React, { useEffect, useState } from "react";
import Sidebar from "./Sidebar";
import Header from "./Header";
import "./Dokumenty.css";
import DocumentsModal from "./DocumentsModal";
import InvoiceModal from "./InvoiceModal";

const Dokumenty = () => {
  const [documents, setDocuments] = useState([]);
  const [sortConfig, setSortConfig] = useState({ key: "date", direction: "desc" });
  const user = JSON.parse(localStorage.getItem("user")) || {};
  const [isDocumentsModalOpen, setIsDocumentsModalOpen] = useState(false);
  const [isInvoiceModalOpen, setIsInvoiceModalOpen] = useState(false);

  const toggleDocumentsModal = () => setIsDocumentsModalOpen(!isDocumentsModalOpen);
  const toggleInvoiceModal = () => setIsInvoiceModalOpen(!isInvoiceModalOpen);

  const fetchDocuments = async () => {
    try {
      const response = await fetch("/api/documents", { method: "GET" });
      const data = await response.json();
      setDocuments(data.sort((a, b) => (a.date < b.date ? 1 : -1)));
    } catch (error) {
      console.error("Error fetching documents:", error);
    }
  };

  const sortDocuments = (key) => {
    const direction =
      sortConfig.key === key && sortConfig.direction === "asc" ? "desc" : "asc";
    setDocuments((docs) =>
      [...docs].sort((a, b) =>
        direction === "asc" ? (a[key] > b[key] ? 1 : -1) : (a[key] < b[key] ? 1 : -1)
      )
    );
    setSortConfig({ key, direction });
  };

  useEffect(() => {
    fetchDocuments();
  }, []);

  const handleLogout = () => {
    localStorage.removeItem("isAuthenticated");
    window.location.href = "/";
  };

  return (
    <div className="dashboard-container">
      <Sidebar />
      <div className="main-content">
        <Header user={user} onLogout={handleLogout} />
        <div className="dokumenty-content">
          <div className="header-with-button">
            <h1>Dokumenty</h1>
            <button className="add-btn" onClick={toggleDocumentsModal}>
              <img src="./Add.svg" alt="Add Icon" className="add-icon" />
            </button>
          </div>
          <table className="documents-table">
            <thead>
              <tr>
                <th onClick={() => sortDocuments("name")}>Názov</th>
                <th onClick={() => sortDocuments("popis")}>Popis</th>
                <th onClick={() => sortDocuments("type")}>Typ</th>
                <th onClick={() => sortDocuments("fileType")}>Typ súboru</th>
                <th onClick={() => sortDocuments("date")}>Dátum</th>
                <th>Stiahnuť</th>
              </tr>
            </thead>
            <tbody>
              {documents.map((doc) => (
                <tr key={doc.id}>
                  <td>{doc.name}</td>
                  <td>{doc.popis}</td>
                  <td>{doc.type}</td>
                  <td>{doc.fileType}</td>
                  <td>{doc.date}</td>
                  <td>
                    <a href={doc.url} download>
                      <img src="./download-file.svg" alt="Download" className="download-icon" />
                    </a>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
        <DocumentsModal
          isOpen={isDocumentsModalOpen}
          toggleModal={toggleDocumentsModal}
          refreshDocuments={fetchDocuments}
        />
        <InvoiceModal isOpen={isInvoiceModalOpen} toggleModal={toggleInvoiceModal} />
      </div>
    </div>
  );
};

export default Dokumenty;
